import { useState } from 'react';
import './App.css';

function extract(url){
  console.log(url);
  url_calling(url);
}
function url_calling(url){
  var data
  fetch(url).then(response=> response.body).then(console.log(data));
}
function App() {
  const [url,setUrl] = useState('');
  const handleChange = event => {
    setUrl(event.target.value);
    console.log(event.target.value);
  }
  return (
    <div className="App">
      <header className="App-header">
        <div className="Url">
          <p>Input the Wikipedia URL</p>
          <textarea id="url" name="url" 
          value={url}
          onChange={handleChange}
          style={{width:500+'px'}}></textarea>
          <button onClick={e=>extract(url)}>Generate</button>
        </div>
      </header>
    </div>
  );
}

export default App;
